package Tree;import Temp.Temp;import Temp.Label;import java.util.LinkedList;public class MoveCall extends Tree.Stm {	Tree.TEMP dst;	Tree.CALL src;	public MoveCall(Tree.TEMP d, Tree.CALL s) {dst=d; src=s;}	public LinkedList<Tree.Exp> kids() {return src.kids();}		public Tree.Stm build(LinkedList<Tree.Exp> kids) {		return new Tree.MOVE(dst, src.build(kids));	}		public void accept(IntVisitor v, int d) {		v.visit(this, d); 	}		public void accept(CodeVisitor v) {		v.visit(this);	}		public <R> R accept(ResultVisitor<R> v) {		return v.visit(this); 	}}   